description:
50% of proceeds will be donated to thewereachfoundation.org for Haiti's earthquake victims.


Owner of Elite Key Life Insurance "Frantz Joachim"  makes a cameo appearance in short film "Lifestyle of a new age low key Investor."  Digital ambassadors volunteer their time to bring awareness to Haiti's earthquake victims. The members of this cast are comprised of gold, crypto and real estate investors. Our cast was strategically assembled to showcase some of Miami's local businesses and professionals. Also local business owners make cameo appearances and product placements. The Blue Lagoon Redland Farm in Homestead, Florida, location was used in the film storyline, as an off-grid private meet up, where new age low key investors network.  


